import React from 'react';
import { EventsList } from '../TextInfo';


const Events = () => {
    return (
        <span className='hth_li supplier'>
            {EventsList.map( ( item, index ) => {
                return (
                    <span key={index} className="healthCard">
                        <HealthBlock itemi={item} />
                    </span>
                );
            } )}
        </span>
    );
}

export default Events
